class switch:
    white = (255, 255, 255)
    def __init__(self, screen, cords, command, starting_state=False, size=(width//15, height//30), text=None, text_color=white):
        self.screen = screen
        self.cords = cords
        self.state = starting_state
        self.size = size
        self.command = command
        self.on_image = py.image.load("on_switch.png")
        self.on_image = py.transform.scale(self.on_image, self.size)
        self.off_image = py.image.load("off_switch.png")
        self.off_image = py.transform.scale(self.off_image, self.size)
        if self.state:
            self.image = self.on_image
        else:
            self.image = self.off_image
        self.rect = self.image.get_rect()
        self.rect.x = cords[0]
        self.rect.y = cords[1]
        self.clicked = True
        self.text_size = (self.size[0]+self.size[1])*2
        self.text = text
        if self.text != None:
            self.font = py.font.SysFont("arial", self.text_size//len(text))
            self.text = self.font.render(text, 1, text_color)
            self.text_rect = self.text.get_rect()
            self.text_rect.center = (self.cords[0]+(self.size[0]//2), self.cords[1]-(self.size[1]))
    def draw(self):
        if self.state:
            self.image = self.on_image
        else:
            self.image = self.off_image
        pos = py.mouse.get_pos()
        if py.mouse.get_pressed()[0] == 1 and self.clicked == False and self.rect.collidepoint(pos):
            self.command()
            self.state = not self.state
            self.clicked = True
        if py.mouse.get_pressed()[0] == 0:
            self.clicked = False
        self.screen.blit(self.image, self.rect)
        if self.text != None:
            self.screen.blit(self.text, self.text_rect)
class projectile:
    def __init__(self, screen, cords, image_list, damage, target, path_type, size=(width//50, height//50), colorkey=None, speed=10):
        all_path_types = ["straight"]
        self.screen = screen
        self.cords = cords
        self.image_list = []
        self.width = size[0]
        self.height = size[1]
        for image in image_list:
            image = py.image.load(image)
            image = py.transform.scale(image, (self.width, self.height))
            if colorkey != None:
                image.set_colorkey(colorkey)
            image_rect = image.get_rect()
            image_rect.center = self.cords
            self.image_list.append((image, image_rect))
        self.index = 0
        self.damage = damage
        self.target = target
        self.path_type = path_type
        self.speed = speed
        if not self.path_type in all_path_types:
            print("ERROR: NOT A PATH TYPE. GET TO WORK ERIC")
            save()
            py.quit()
            quit()
        if self.path_type == "straight":
            self.A = self.cords
            self.B = self.target.rect.center
            self.C = (self.target.rect.center[0], self.cords[1])
            self.AC = abs(self.A[0]-self.B[0])
            self.BC = abs(self.A[1]-self.B[1])
            if self.BC != 0 and self.AC != 0: self.angle =int(math.degrees(math.atan(self.BC/self.AC)))
            else: self.angle = 0
            quad = self.get_quad()
            if quad == 1: pass
            elif quad == 2: self.angle = 180 - self.angle
            elif quad == 3: self.angle += 180
            elif quad == 4: self.angle = 360 - self.angle
            if self.angle != 0: self.angle -= 1
        self.actual_rect_cords = self.image_list[self.index][1].center
        self.yes = False
    def draw(self):
        global projectiles, paused
        self.image = self.image_list[self.index][0]
        self.rect = self.image_list[self.index][1]
        self.rect.center = self.actual_rect_cords
        if not paused:
            if self.check_hit():
                self.enemy_hit.hp -= self.damage
                projectiles.remove(self)
            if self.off_screen():
                try:
                    projectiles.remove(self)
                except ValueError:
                    pass
            if self.path_type == "straight":
                self.forward(self.speed)
        self.screen.blit(self.image, self.rect)
        #py.draw.polygon(self.screen, (0, 0, 0), [self.A, self.B, self.C])
    def check_hit(self):
        for enemy in enemys:
            try:
                if self.rect.colliderect(enemy.rect):
                    self.enemy_hit = enemy
                    self.yes = True
                    break
                else:
                    self.yes = False
            except AttributeError:
                pass
        return self.yes
    def off_screen(self):
        if not 0 < self.actual_rect_cords[0] < width:
            return True
        if not 0 < self.actual_rect_cords[1] < height:
            return True
