class round:
    def __init__(self, data):
        self.data = data
        self.counter = 0
        self.done_making = False
        self.done = False
    def run(self):
        global paused, map, enemys, projectiles
        if not paused:
            if self.counter != len(self.data):
                if self.data[self.counter] != "-":
                    spawn_enemy(self.data[self.counter][0], self.data[self.counter][1], map, self.data[self.counter][2])
                self.counter += 1
            else:
                self.done_making = True
            if self.done_making and len(enemys) == 0 and len(projectiles) == 0:
                self.done = True
class full_game:
    def __init__(self, rounds):
        self.rounds = rounds
        self.number_of_rounds = len(self.rounds)
        self.round_on = 0
        self.did = False
    def run(self):
        global save_vars, paused, projectiles
        if not paused:
            if self.round_on != self.number_of_rounds:
                self.rounds[self.round_on].run()
                if self.rounds[self.round_on].done:
                    if save_vars["auto_play"]:
                        if not self.did:
                            unpause()
                            self.did = True
                    else:
                        if not self.did:
                            pause()
                            self.did = True
                    if not paused:
                        self.round_on += 1
                else:
                    self.did = False
def start_game():
    global screen_on, page_on, settings_wheel, pages, just_opened
    unpause()
    if not just_opened:
        for page in pages:
            page.counter = 0
            page.selecting_mode = False
    else:
        for page in pages:
            page.counter = fps
    settings_wheel.opened = False
